import React from 'react';
import { useTranslation } from 'react-i18next';
import { Translation } from 'react-i18next';
import './Eventos.css';



const Eventos = () => {
  const { t } = useTranslation();


  return (
    <div className="container">

      {/* Hackathon Section */}
      <div className="event">
        <img src="hackathon_image.jpg" alt="Hackathon" />
        <h2>{t('hackathon_title')}</h2>
        <p>{t('hackathon_description')}</p>
        <a href="https://hackathon-2024.com" target="_blank" rel="noopener noreferrer">
          {t('hackathon_link')}
        </a>
      </div>

      {/* Deep Racing Section */}
      <div className="event">
        <img src="deepracing_image.jpg" alt="Deep Racing" />
        <h2>{t('deepracing_title')}</h2>
        <p>{t('deepracing_description')}</p>
        <a href="https://deepracing.com" target="_blank" rel="noopener noreferrer">
          {t('deepracing_link')}
        </a>
      </div>
    </div>
  );
};

export default Eventos;
